import React from 'react';
import { BsSuitHeartFill } from 'react-icons/bs';
import { FaSchool, FaMapMarkerAlt } from 'react-icons/fa';
import { IoHomeSharp } from 'react-icons/io5';
import { GiNetworkBars } from 'react-icons/gi';
import './About.css';

const About = () => {
    return (
        <div className="p-3">
            <h6 className="news-feed-title text-white pb-2">About</h6>
            <div className="my-3">
                <p className="d-flex align-items-center">
                    <span><FaSchool className="user-about-icon" /></span>
                    <span className="ms-2 user-about-info">Went to kamar ali high school</span>
                </p>
                <p className="d-flex align-items-center">
                    <span><BsSuitHeartFill className="user-about-icon" /></span>
                    <span className="ms-2 user-about-info">Single</span>
                </p>
                <p className="d-flex align-items-center">
                    <span><IoHomeSharp className="user-about-icon" /></span>
                    <span className="ms-2 user-about-info">Lives in Narayangang</span>
                </p>
                <p className="d-flex align-items-center">
                    <span><FaMapMarkerAlt className="user-about-icon" /></span>
                    <span className="ms-2 user-about-info">From Narayangang</span>
                </p>
                <p className="d-flex align-items-center">
                    <span><GiNetworkBars className="user-about-icon" /></span>
                    <span className="ms-2 user-about-info">Followed By 653 People</span>
                </p>
            </div>
        </div>
    );
};

export default About;
